import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";
import ListaExpositores from "./components/ListaExpositores";
import CrearExpositor from "./components/CrearExpositor";
import EditarExpositor from "./components/EditarExpositor";
import SubirContenido from "./components/SubirContenido";
import ListaGaleria from "./components/ListaGaleria";
import CrearGaleria from "./components/CrearGaleria";
import FormularioPremio from './components/FormularioPremio';  
import ListaPremios from './components/ListaPremios';  
import EditarPremio from './components/EditarPremio';

function App() {
    return (
        <Router>
            <Navbar />
            <div style={{ padding: "20px" }}>
                <Routes>
                    <Route path="/" element={<h2>Bienvenido a la Galer√≠a de Proyectos</h2>} />
                    <Route path="/crear" element={<CrearExpositor />} />
                    <Route path="/expositores" element={<ListaExpositores />} />
                    <Route path="/editar/:id" element={<EditarExpositor />} />
                    <Route path="/expositor/:id/subir" element={<SubirContenido />} />
                    <Route path="/crear-galeria" element={<CrearGaleria />} />
                    <Route path="/galeria" element={<ListaGaleria />} />
                    <Route path="/crear-premio" element={<FormularioPremio />} />
                    <Route path="/premios" element={<ListaPremios />} />
                    <Route path="/premios" element={<ListaPremios />} />
                    <Route path="/editar-premio/:id" element={<EditarPremio />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
